  [],\n\t\"revision_timestamp\": \"2016-07-15T04:24:04.282897\",\n\t\"name\": \"health-insurance-rate-review-fact-sheet-c0f7e\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Affordable Care Act is bringing an
  unprecedented level of scrutiny and transparency to health insurance rate increases.
  The Act ensures that, in any State, any proposed rate increase by individual or
  small group market insurers at or above 10 percent will be scrutinized by independent
  experts to make sure it is justified. This analysis will help moderate premium hikes
  and lower costs for individuals, families, and businesses that buy insurance in
  these markets. Additionally, insurance companies must provide easy to understand
  information to their customers about their reasons for unreasonable rate increases,
  as well as publicly justify and post on their website any unreasonable rate increases.
  These steps allow consumers to know why they are paying higher rates.</p>n\",\n\t\"license_title\":
